        "$:/plugins/twpub/b153d89bc523601a/text/000000011": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>This License is a kind of &quot;copyleft&quot;, which means that derivative<br>\nworks of the document must themselves be free in the same sense.  It<br>\ncomplements the GNU General Public License, which is a copyleft<br>\nlicense designed for free software.</p></div>"
