        "$:/plugins/twpub/b153d89bc523601a/text/000000013": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>1. APPLICABILITY AND DEFINITIONS</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000014": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>This License applies to any manual or other work that contains a<br>\nnotice placed by the copyright holder saying it can be distributed<br>\nunder the terms of this License.  The &quot;Document&quot;, below, refers to any<br>\nsuch manual or work.  Any member of the public is a licensee, and is<br>\naddressed as &quot;you&quot;.</p></div>"
