        "$:/plugins/twpub/b153d89bc523601a/text/000000015": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>A &quot;Modified Version&quot; of the Document means any work containing the<br>\nDocument or a portion of it, either copied verbatim, or with<br>\nmodifications and/or translated into another language.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000016": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>A &quot;Secondary Section&quot; is a named appendix or a front-matter section of<br>\nthe Document that deals exclusively with the relationship of the<br>\npublishers or authors of the Document to the Document's overall subject<br>\n(or to related matters) and contains nothing that could fall directly<br>\nwithin that overall subject.  (For example, if the Document is in part a<br>\ntextbook of mathematics, a Secondary Section may not explain any<br>\nmathematics.)  The relationship could be a matter of historical<br>\nconnection with the subject or with related matters, or of legal,<br>\ncommercial, philosophical, ethical or political position regarding<br>\nthem.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000017": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>The &quot;Invariant Sections&quot; are certain Secondary Sections whose titles<br>\nare designated, as being those of Invariant Sections, in the notice<br>\nthat says that the Document is released under this License.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000018": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>The &quot;Cover Texts&quot; are certain short passages of text that are listed,<br>\nas Front-Cover Texts or Back-Cover Texts, in the notice that says that<br>\nthe Document is released under this License.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000019": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>A &quot;Transparent&quot; copy of the Document means a machine-readable copy,<br>\nrepresented in a format whose specification is available to the<br>\ngeneral public, whose contents can be viewed and edited directly and<br>\nstraightforwardly with generic text editors or (for images composed of<br>\npixels) generic paint programs or (for drawings) some widely available<br>\ndrawing editor, and that is suitable for input to text formatters or<br>\nfor automatic translation to a variety of formats suitable for input<br>\nto text formatters.  A copy made in an otherwise Transparent file<br>\nformat whose markup has been designed to thwart or discourage<br>\nsubsequent modification by readers is not Transparent.  A copy that is<br>\nnot &quot;Transparent&quot; is called &quot;Opaque&quot;.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000020": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>Examples of suitable formats for Transparent copies include plain<br>\nASCII without markup, Texinfo input format, LaTeX input format, SGML<br>\nor XML using a publicly available DTD, and standard-conforming simple<br>\nHTML designed for human modification.  Opaque formats include<br>\nPostScript, PDF, proprietary formats that can be read and edited only<br>\nby proprietary word processors, SGML or XML for which the DTD and/or<br>\nprocessing tools are not generally available, and the<br>\nmachine-generated HTML produced by some word processors for output<br>\npurposes only.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000021": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>The &quot;Title Page&quot; means, for a printed book, the title page itself,<br>\nplus such following pages as are needed to hold, legibly, the material<br>\nthis License requires to appear in the title page.  For works in<br>\nformats which do not have any title page as such, &quot;Title Page&quot; means<br>\nthe text near the most prominent appearance of the work's title,<br>\npreceding the beginning of the body of the text.<br>\n </p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000022": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>2. VERBATIM COPYING</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000023": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>You may copy and distribute the Document in any medium, either<br>\ncommercially or noncommercially, provided that this License, the<br>\ncopyright notices, and the license notice saying this License applies<br>\nto the Document are reproduced in all copies, and that you add no other<br>\nconditions whatsoever to those of this License.  You may not use<br>\ntechnical measures to obstruct or control the reading or further<br>\ncopying of the copies you make or distribute.  However, you may accept<br>\ncompensation in exchange for copies.  If you distribute a large enough<br>\nnumber of copies you must also follow the conditions in section 3.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000024": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>You may also lend copies, under the same conditions stated above, and<br>\nyou may publicly display copies.<br>\n </p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000025": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>3. COPYING IN QUANTITY</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000026": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>If you publish printed copies of the Document numbering more than 100,<br>\nand the Document's license notice requires Cover Texts, you must enclose<br>\nthe copies in covers that carry, clearly and legibly, all these Cover<br>\nTexts: Front-Cover Texts on the front cover, and Back-Cover Texts on<br>\nthe back cover.  Both covers must also clearly and legibly identify<br>\nyou as the publisher of these copies.  The front cover must present<br>\nthe full title with all words of the title equally prominent and<br>\nvisible.  You may add other material on the covers in addition.<br>\nCopying with changes limited to the covers, as long as they preserve<br>\nthe title of the Document and satisfy these conditions, can be treated<br>\nas verbatim copying in other respects.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000027": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>If the required texts for either cover are too voluminous to fit<br>\nlegibly, you should put the first ones listed (as many as fit<br>\nreasonably) on the actual cover, and continue the rest onto adjacent<br>\npages.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000028": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>If you publish or distribute Opaque copies of the Document numbering<br>\nmore than 100, you must either include a machine-readable Transparent<br>\ncopy along with each Opaque copy, or state in or with each Opaque copy<br>\na publicly-accessible computer-network location containing a complete<br>\nTransparent copy of the Document, free of added material, which the<br>\ngeneral network-using public has access to download anonymously at no<br>\ncharge using public-standard network protocols.  If you use the latter<br>\noption, you must take reasonably prudent steps, when you begin<br>\ndistribution of Opaque copies in quantity, to ensure that this<br>\nTransparent copy will remain thus accessible at the stated location<br>\nuntil at least one year after the last time you distribute an Opaque<br>\ncopy (directly or through your agents or retailers) of that edition to<br>\nthe public.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000029": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>It is requested, but not required, that you contact the authors of the<br>\nDocument well before redistributing any large number of copies, to give<br>\nthem a chance to provide you with an updated version of the Document.<br>\n </p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000030": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>4. MODIFICATIONS</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000031": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>You may copy and distribute a Modified Version of the Document under<br>\nthe conditions of sections 2 and 3 above, provided that you release<br>\nthe Modified Version under precisely this License, with the Modified<br>\nVersion filling the role of the Document, thus licensing distribution<br>\nand modification of the Modified Version to whoever possesses a copy<br>\nof it.  In addition, you must do these things in the Modified Version:</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000032": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>A. Use in the Title Page (and on the covers, if any) a title distinct<br>\n   from that of the Document, and from those of previous versions<br>\n   (which should, if there were any, be listed in the History section<br>\n   of the Document).  You may use the same title as a previous version<br>\n   if the original publisher of that version gives permission.<br>\nB. List on the Title Page, as authors, one or more persons or entities<br>\n   responsible for authorship of the modifications in the Modified<br>\n   Version, together with at least five of the principal authors of the<br>\n   Document (all of its principal authors, if it has less than five).<br>\nC. State on the Title page the name of the publisher of the<br>\n   Modified Version, as the publisher.<br>\nD. Preserve all the copyright notices of the Document.<br>\nE. Add an appropriate copyright notice for your modifications<br>\n   adjacent to the other copyright notices.<br>\nF. Include, immediately after the copyright notices, a license notice<br>\n   giving the public permission to use the Modified Version under the<br>\n   terms of this License, in the form shown in the Addendum below.<br>\nG. Preserve in that license notice the full lists of Invariant Sections<br>\n   and required Cover Texts given in the Document's license notice.<br>\nH. Include an unaltered copy of this License.<br>\nI. Preserve the section entitled &quot;History&quot;, and its title, and add to<br>\n   it an item stating at least the title, year, new authors, and<br>\n   publisher of the Modified Version as given on the Title Page.  If<br>\n   there is no section entitled &quot;History&quot; in the Document, create one<br>\n   stating the title, year, authors, and publisher of the Document as<br>\n   given on its Title Page, then add an item describing the Modified<br>\n   Version as stated in the previous sentence.<br>\nJ. Preserve the network location, if any, given in the Document for<br>\n   public access to a Transparent copy of the Document, and likewise<br>\n   the network locations given in the Document for previous versions<br>\n   it was based on.  These may be placed in the &quot;History&quot; section.<br>\n   You may omit a network location for a work that was published at<br>\n   least four years before the Document itself, or if the original<br>\n   publisher of the version it refers to gives permission.<br>\nK. In any section entitled &quot;Acknowledgements&quot; or &quot;Dedications&quot;,<br>\n   preserve the section's title, and preserve in the section all the<br>\n   substance and tone of each of the contributor acknowledgements<br>\n   and/or dedications given therein.<br>\nL. Preserve all the Invariant Sections of the Document,<br>\n   unaltered in their text and in their titles.  Section numbers<br>\n   or the equivalent are not considered part of the section titles.<br>\nM. Delete any section entitled &quot;Endorsements&quot;.  Such a section<br>\n   may not be included in the Modified Version.<br>\nN. Do not retitle any existing section as &quot;Endorsements&quot;<br>\n   or to conflict in title with any Invariant Section.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000033": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>If the Modified Version includes new front-matter sections or<br>\nappendices that qualify as Secondary Sections and contain no material<br>\ncopied from the Document, you may at your option designate some or all<br>\nof these sections as invariant.  To do this, add their titles to the<br>\nlist of Invariant Sections in the Modified Version's license notice.<br>\nThese titles must be distinct from any other section titles.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000034": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>You may add a section entitled &quot;Endorsements&quot;, provided it contains<br>\nnothing but endorsements of your Modified Version by various<br>\nparties--for example, statements of peer review or that the text has<br>\nbeen approved by an organization as the authoritative definition of a<br>\nstandard.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000035": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>You may add a passage of up to five words as a Front-Cover Text, and a<br>\npassage of up to 25 words as a Back-Cover Text, to the end of the list<br>\nof Cover Texts in the Modified Version.  Only one passage of<br>\nFront-Cover Text and one of Back-Cover Text may be added by (or<br>\nthrough arrangements made by) any one entity.  If the Document already<br>\nincludes a cover text for the same cover, previously added by you or<br>\nby arrangement made by the same entity you are acting on behalf of,<br>\nyou may not add another; but you may replace the old one, on explicit<br>\npermission from the previous publisher that added the old one.</p></div>"
