            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>개$^2$ a dog; a hound. 수캐 a male dog. 암캐 a bitch. 들캐 a stray dog. 개를 기르다<br>\nkeep a dog.<br>\n개가 짖다 a dog barks.</p></div>"
