            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>걷다 1.~roll [turn] up (one's sleeves); tuck up; fold up.<br>\n소매를 걷어 올리다 tuck [roll] up one's sleeves.<br>\n2.~remove; take away; take down; pull down.<br>\n3.~walk</p></div>"
