            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>걸리다 1.~hang (from, on)<br>\n2.~be against (a law); trespass (a law); be contrary to.<br>\n3.~take (time)</p></div>"
