            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>걸어오다 walk, come on foot</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000109": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>걸음 walking; stepping; a step; pace.<br>\n한걸음 한걸음 step by step. 빠른 걸음으로 at a rapid pace; with a rapid step.<br>\n걸음을 재촉하다 [늦추다] quicken [slacken] one's pace</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000110": {
