        "$:/plugins/twpub/b153d89bc523601a/text/000000112": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>결흔 marriage; wedding; matrimony.<br>\n하다 marry (her, him); get [be] married (to).<br>\n결흔 신청을 하다 make a proposal of marriage (to); propose to (her)<br>\n </p></div>"
