            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>경제 經濟 economy. 경제학 economics</p></div>"
