            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>계산 計算 calculation; computation; reckoning. 하다 calculate;<br>\ncompute; count. 계산서 bill, check</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000000115": {
