            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>계시다 (honorific) be; stay.<br>\n한국에 얼마나 계셨읍니까? How long have you been in Korea?</p></div>"
