            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>고양이 cat; a puss(y). 고양이 새끼 a kitten; a kitty.<br>\n수코양이 a he-cat; a tomcat; a male cat.<br>\n암코양이 a she-cat; a female cat</p></div>"
