            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>공부 工夫 study; learning. 하다 study; work at [on] (one's studies);<br>\nlearn. 공부를 잘 하다 be good at one's studies</p></div>"
