            "title": "$:/plugins/twpub/b153d89bc523601a/text/000000136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>과실 果實 a fruit; [총칭] fruit; fruitage.<br>\n과실을 재배하다 grow fruit. 과실을 따다 pick [pluck] fruit</p></div>"
