            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>태극기 太極旗 the national flag of Korea, the Tai-geuk flag<br>\nThe Korean flag is called T\\ae{gukgi. It's design symbolizes<br>\nthe principles of yin and yang in Oriental philosophy.<br>\nThe circle in the center of the flag is divided into two equal<br>\nparts. The upper red section represents the positive cosmic forces of<br>\nyang. Conversely, the lower blue section represents the negative<br>\ncosmic forces of yin.</p></div>"
        },
        "$:/plugins/twpub/b153d89bc523601a/text/000001021": {
            "role": "text",
            "title": "$:/plugins/twpub/b153d89bc523601a/text/000001021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-b153d89bc523601a-6b4cd0\"><p>The two forces together embody the concepts of continual<br>\nmovement and balance and harmony that characterize the sphere<br>\nof infinity. The circle is surrounded by four trigrams in each<br>\ncorner. Each trigram symbolizes one of the four universal elements:<br>\nheaven, earth, fire, and water.</p></div>"
        },
